import cats from "./Cats";

export default function Grid() {
  console.log(cats);

  return (
    <div className="grid grid-cols-2 place-content-center md:max-w-max md:mx-auto md:grid-cols-3 lg:grid-cols-5 mt-12">
      {cats.map((cat, index) =>
      <div key={index} className="vignette flex flex-col justify-center items-center text-center bg-white z-0 md:h-80 w-80 mx-auto mr-3 pb-2 rounded-3xl shadow-xl">
        <p className="text-center">{cat.name}</p>
        <img
          src={cat.image}
          className="z-20 h-40 md:h-72 my-3 object-cover mx-auto"
          alt={cat.name}
        />
        <p className="text-center">{cat.race}</p>
      </div>
      )}
    </div>
  );
}
